import { NavbarContainer, NavbarWrapper } from "./Navbar.elements"

const Navbar = () => {
    return (
        <>
            <NavbarContainer>
                <NavbarWrapper>
                    <h1>Hola soy el Navbar</h1>
                </NavbarWrapper>
            </NavbarContainer>
        </>
    )
}

export default Navbar
